import { Box, Typography } from "@mui/material";
import MyButton from '../../../components/MyButton'

const Header = () =>{
    return(
        <Box sx={{margin: "16px 0px;", display:'flex', justifyContent:'center', alignItems:'center', height:'486px', flexDirection:'column',textAlign:'center' }}>
            <Typography sx={{fontSize:"24px", letterSpacing:'6px', fontFamily:'Raleway', margin:'10px 0', fontWeight:'400',opacity:'0.5'}}>
                PHOTOGRAPHER
            </Typography>
            <Typography sx={{fontSize:"36px", letterSpacing:'6px', fontFamily:'Raleway', margin:'10px 0', fontWeight:'400',opacity:'0.5'}}>
                John Doe
            </Typography>
            <Box
                sx={{
                    display: 'flex',
                    justifyContent: 'center', // Distribuye los botones con espacio entre ellos
                    alignItems: 'center',             // Alinea los botones verticalmente en el centro
                    padding: '32px 0px',
                    width: '100%',
                }}
            >
                <Box sx={{
                     display: 'flex',             // Hace que los elementos sean flexibles y estén en fila
                     alignItems: 'center',        // Alinea los botones verticalmente en el centro
                     border: '1px solid #e0e0e0', // Borde del contenedor (opcional)
                     width: '356px',              // Define el ancho del contenedor
                    }}>                    
                    <MyButton text="Home"/>
                    <MyButton text="Home"/>
                    <MyButton text="Home"/>
                    <MyButton text="Home"/>
                </Box>
            </Box>
        </Box>
    );
}

export default Header
